const ItemList = ({detalles }) => { 

  
    return (

        <>
               {detalles.map((detalle, i)=>{
            return <Item key={detalles.id} name={detalles.title} price={detalles.price} stock={detalles.stock}  />

        })

        }
        


</>

)}

